/************************************************************
 *
 * Autor: Zoinks
 *
 * 446576656c6f7065723a20416e746f6e20506f6c656e79616b61 ****/

// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.15;

import "./librarys/SafeMath.sol";
import "./abstract/Ownable.sol";
import "./librarys/SafeBEP20.sol";
import "./CakeToken.sol";
import "./interfaces/IMigratorChef.sol";

// MasterChef is the master of Cake. He can make Cake and he is a fair guy.
//
// Note that it's ownable and the owner wields tremendous power. The ownership
// will be transferred to a governance smart contract once CAKE is sufficiently
// distributed and the community can show to govern itself.
//
// Have fun reading it. Hopefully it's bug-free. God bless.
contract MasterChef is Ownable {
    using SafeMath for uint256;
    using SafeBEP20 for IBEP20;
    using SafeBEP20 for CakeToken;

    // The address of the smart chef factory
    address public SMART_CHEF_FACTORY;

    // Info of each user.
    struct UserInfo {
        uint256 amount; // How many LP tokens the user has provided.
        uint256 rewardDebtZoinks; // Reward debt of zoinks. See explanation below.
        uint256 rewardDebtSnacks; // Reward debt of snacks. See explanation below.
        uint256 rewardDebtEthSnacks; // Reward debt of ethSnacks. See explanation below.
        uint256 rewardDebtBtcSnacks; // Reward debt of btcSnacks. See explanation below.
        uint256 lastDepositDate; // Last Withdraw Time
        //
        // We do some fancy math here. Basically, any point in time, the amount of CAKEs
        // entitled to a user but is pending to be distributed is:
        //
        //   pending reward = (user.amount / total lp amount) * new reward
        //
        // Whenever a user deposits or withdraws LP tokens to a pool. Here's what happens:
        //   1. User receives User's `rewardDebt` sent to his/her address.
        //   2. User's `amount` gets updated.
        //   3. User's `rewardDebt` gets initialized.
        // Whenever a user call distributeReward(). Here's what happens:
        //   User's `rewardDebt` set with pending reward above.
    }

    // Info of each pool.
    struct PoolInfo {
        IBEP20 lpToken; // Address of LP token contract.
        uint256 totalRewardDebtZoinks; // Total Reward debt of zoinks
        uint256 totalRewardDebtSnacks; // Total Reward debt of snacks
        uint256 totalRewardDebtEthSnacks; // Total Reward debt of ethSnacks
        uint256 totalRewardDebtBtcSnacks; // Total Reward debt of btcSnacks
    }

    // The CAKE TOKEN!
    CakeToken public cake;
    // The ZOINKS TOKEN
    BEP20 public zoinks;
    // The SNACKS TOKEN
    BEP20 public snacks;
    // The ETHSNACKS TOKEN
    BEP20 public ethSnacks;
    // The BTCSNACKS TOKEN
    BEP20 public btcSnacks;
    // Bonus muliplier for early cake makers.
    uint256 public BONUS_MULTIPLIER = 1;
    // The migrator contract. It has a lot of power. Can only be set through governance (owner).
    IMigratorChef public migrator;

    // Info of each pool.
    PoolInfo[] public poolInfo;
    // Info of each user that stakes LP tokens.
    mapping(uint256 => mapping(address => UserInfo)) public userInfo;
    address[] public userAddressList;
    // Total allocation poitns. Must be the sum of all allocation points in all pools.

    // Seniorage address
    address public seniorageAddress;

    // Whether it is initialized
    bool public isInitialized;

    //maximum-integer
    uint256 MAX_INT =
        0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff;

    event Deposit(address indexed user, uint256 indexed pid, uint256 amount);
    event EmergencyWithdraw(address indexed user, uint256 indexed pid, uint256 amount);
    event LeaveStaking(address indexed user, uint256 indexed pid, uint256 amount);
    event RewardTransfer(
        address indexed user,
        uint256 zoinksReward
    );
    event SnacksReward(
        address indexed user,
        uint256 snacksReward,
        uint256 ethSnacksReward,
        uint256 btcSnacksReward
    );

    constructor(
        CakeToken _cake,
        address _seniorage
    ) {
        cake = _cake;
        // staking pool
        poolInfo.push(
            PoolInfo({
                lpToken: _cake,
                totalRewardDebtZoinks: 0,
                totalRewardDebtSnacks: 0,
                totalRewardDebtEthSnacks: 0,
                totalRewardDebtBtcSnacks: 0
            })
        );
        seniorageAddress = _seniorage; // Ex.: 0x467927774B59F7cB023863b07960669f958EC19a
    }

    function initialize(
        BEP20 _zoinks,
        BEP20 _snacks,
        BEP20 _ethSnacks,
        BEP20 _btcSnacks
    ) external onlyOwner {
        require(!isInitialized, "Already initialized");

        // Make this contract initialized
        isInitialized = true;

        zoinks = _zoinks;
        snacks = _snacks;
        ethSnacks = _ethSnacks;
        btcSnacks = _btcSnacks;
        //Approve contracts  for rewardTransfer
        zoinks.approve(address(this), MAX_INT);
        snacks.approve(address(this), MAX_INT);
        ethSnacks.approve(address(this), MAX_INT);
        btcSnacks.approve(address(this), MAX_INT);
    }

    function updateMultiplier(uint256 multiplierNumber) public onlyOwner {
        BONUS_MULTIPLIER = multiplierNumber;
    }

    function poolLength() external view returns (uint256) {
        return poolInfo.length;
    }

    // Add a new lp to the pool. Can only be called by the owner.
    // XXX DO NOT add the same LP token more than once. Rewards will be messed up if you do.
    function add(IBEP20 _lpToken, bool _withUpdate) public onlyOwner {
        if (_withUpdate) {
            massUpdatePools();
        }
        poolInfo.push(
            PoolInfo({
                lpToken: _lpToken,
                totalRewardDebtZoinks: 0,
                totalRewardDebtSnacks: 0,
                totalRewardDebtEthSnacks: 0,
                totalRewardDebtBtcSnacks: 0
            })
        );
    }

    // Set the migrator contract. Can only be called by the owner.
    function setMigrator(IMigratorChef _migrator) public onlyOwner {
        migrator = _migrator;
    }

    // Migrate lp token to another lp contract. Can be called by anyone. We trust that migrator contract is good.
    function migrate(uint256 _pid) public {
        require(address(migrator) != address(0), "migrate: no migrator");
        PoolInfo storage pool = poolInfo[_pid];
        IBEP20 lpToken = pool.lpToken;
        uint256 bal = lpToken.balanceOf(address(this));
        lpToken.safeApprove(address(migrator), bal);
        IBEP20 newLpToken = migrator.migrate(lpToken);
        require(bal == newLpToken.balanceOf(address(this)), "migrate: bad");
        pool.lpToken = newLpToken;
    }

    // Return reward multiplier over the given _from to _to block.
    function getMultiplier(uint256 _from, uint256 _to)
        public
        view
        returns (uint256)
    {
        return _to.sub(_from).mul(BONUS_MULTIPLIER);
    }

    // View function to see pending CAKEs on frontend.
    function pendingCake(uint256 _pid, address _user)
        external
        view
        returns (uint256)
    {
        return userInfo[_pid][_user].rewardDebtZoinks;
    }

    // Update reward variables for all pools. Be careful of gas spending!
    function massUpdatePools() public {
        uint256 length = poolInfo.length;
        uint256 totalSupply;
        uint256 rewardZoinks = zoinks.balanceOf(address(this));
        uint256 pid = 1;
        for (pid = 1; pid < length; ++pid) {
            totalSupply = totalSupply.add(
                poolInfo[pid].lpToken.balanceOf(address(this))
            );
            rewardZoinks = rewardZoinks.sub(
                poolInfo[pid].totalRewardDebtZoinks
            );
        }
        if (rewardZoinks > 0) {
            for (pid = 1; pid < length; ++pid) {
                updatePool(totalSupply, rewardZoinks, pid);
            }
        }
        if (length >= 1) {
            PoolInfo storage pool = poolInfo[1];
            uint256 lpSupply = pool.lpToken.balanceOf(address(this));
            require(lpSupply != 0, "lpSupply is 0");
            uint256 rewardSnacks = snacks.balanceOf(address(this)).sub(
                pool.totalRewardDebtSnacks
            );
            if (rewardSnacks > 0) {
                for (uint256 i = 0; i < userAddressList.length; i++) {
                    userInfo[1][userAddressList[i]]
                        .rewardDebtSnacks += rewardSnacks
                        .mul(userInfo[1][userAddressList[i]].amount)
                        .div(lpSupply);
                }
                pool.totalRewardDebtSnacks = pool.totalRewardDebtSnacks.add(
                    rewardSnacks
                );
            }
            uint256 rewardEthSnacks = ethSnacks.balanceOf(address(this)).sub(
                pool.totalRewardDebtEthSnacks
            );
            if (rewardEthSnacks > 0) {
                for (uint256 i = 0; i < userAddressList.length; i++) {
                    userInfo[1][userAddressList[i]]
                        .rewardDebtEthSnacks += rewardEthSnacks
                        .mul(userInfo[1][userAddressList[i]].amount)
                        .div(lpSupply);
                }
                pool.totalRewardDebtEthSnacks = pool
                    .totalRewardDebtEthSnacks
                    .add(rewardEthSnacks);
            }
            uint256 rewardBtcSnacks = btcSnacks.balanceOf(address(this)).sub(
                pool.totalRewardDebtBtcSnacks
            );
            if (rewardBtcSnacks > 0) {
                for (uint256 i = 0; i < userAddressList.length; i++) {
                    userInfo[1][userAddressList[i]]
                        .rewardDebtBtcSnacks += rewardBtcSnacks
                        .mul(userInfo[1][userAddressList[i]].amount)
                        .div(lpSupply);
                }
                pool.totalRewardDebtBtcSnacks = pool
                    .totalRewardDebtBtcSnacks
                    .add(rewardBtcSnacks);
            }
        }
    }

    // Update reward variables of the given pool to be up-to-date.
    function updatePool(
        uint256 totalSupply,
        uint256 rewardZoinks,
        uint256 _pid
    ) internal {
        PoolInfo storage pool = poolInfo[_pid];

        uint256 lpSupply = pool.lpToken.balanceOf(address(this));

        if (lpSupply == 0) {
            return;
        }

        // ! Нет распределения по процентам согласно логике inflationaryEmission
        rewardZoinks = rewardZoinks.mul(lpSupply).div(totalSupply);

        for (uint256 i = 0; i < userAddressList.length; i++) {
            userInfo[_pid][userAddressList[i]].rewardDebtZoinks += rewardZoinks
                .mul(userInfo[_pid][userAddressList[i]].amount)
                .div(lpSupply);
        }

        pool.totalRewardDebtZoinks = pool.totalRewardDebtZoinks.add(
            rewardZoinks
        );
    }

    //add msg.sender to userAddressList
    function addUser() internal {
        bool isExist = false;
        for (uint256 i = 0; i < userAddressList.length; i++) {
            if (userAddressList[i] == msg.sender) {
                isExist = true;
                break;
            }
        }
        if (!isExist) {
            userAddressList.push(msg.sender);
        }
    }
    
    function deposit(uint256 _pid, uint256 _amount) public {
        require(_pid != 0 && _pid < poolInfo.length, "invalid pool id");
        require(_amount > 0, "invalid amount");
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        if (user.amount > 0) {
            rewardTransfer(0);
        }
        pool.lpToken.safeTransferFrom(address(msg.sender), address(this), _amount);
        user.amount = user.amount.add(_amount);
        user.lastDepositDate = block.timestamp;
        addUser();
        emit Deposit(msg.sender, _pid, _amount);
    }
    
    function withdraw(uint256 _pid) public {
        require(_pid != 0 && _pid < poolInfo.length, "invalid pool id");
        rewardTransfer(_pid);
    }

    function emergencyWithdraw(uint256 _pid) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        require(_pid != 0 && _pid < poolInfo.length, "invalid pool id");
        require(user.amount > 0, "nothing to withdraw");
        uint256 amount = user.amount;
        rewardTransfer(_pid);
        pool.lpToken.safeTransfer(msg.sender, amount);
        user.amount = 0;
        emit EmergencyWithdraw(msg.sender, _pid, amount);
    }
    
    // Stake CAKE tokens to MasterChef
    function enterStaking(uint256 _amount) public {
        require(_amount > 0, "invalid amount");
        PoolInfo storage pool = poolInfo[0];
        UserInfo storage user = userInfo[0][msg.sender];
        if (user.amount > 0) {
            rewardTransfer(0);
        }
        pool.lpToken.safeTransferFrom(msg.sender, address(this), _amount);
        user.amount = user.amount.add(_amount);
        user.lastDepositDate = block.timestamp;
        addUser();
        emit Deposit(msg.sender, 0, _amount);
    }

    // Withdraw CAKE tokens from STAKING.
    function leaveStaking(uint256 _amount) public {
        PoolInfo storage pool = poolInfo[0];
        UserInfo storage user = userInfo[0][msg.sender];
        require(user.amount >= _amount, "Insufficient funds on the balance sheet");
        rewardTransfer(0);
        if (_amount > 0) {
            uint256 amountToSeniorage = user.lastDepositDate + 1 days
                > block.timestamp
                ? _amount / 2
                : _amount / 10;
            pool.lpToken.safeTransfer(seniorageAddress, amountToSeniorage);
            pool.lpToken.safeTransfer(msg.sender, _amount - amountToSeniorage);
        }
        emit LeaveStaking(msg.sender, 0, _amount);
    }

    // Safe reward transfer function, just in case if rounding error causes pool to not have enough CAKEs.
    function rewardTransfer(uint256 _pid) internal {
        UserInfo storage user = userInfo[_pid][msg.sender];
        uint256 rewardDebtZoinks = userInfo[_pid][msg.sender].rewardDebtZoinks;
        uint256 amountToSeniorage;
        if (rewardDebtZoinks > 0) {
            amountToSeniorage = block.timestamp < user.lastDepositDate + 1 days
                ? rewardDebtZoinks / 2
                : rewardDebtZoinks / 10;
            zoinks.transferFrom(address(this), seniorageAddress, amountToSeniorage);
            zoinks.transferFrom(address(this), msg.sender, rewardDebtZoinks - amountToSeniorage);
            userInfo[_pid][msg.sender].rewardDebtZoinks = 0;
            poolInfo[_pid].totalRewardDebtZoinks = poolInfo[_pid]
                .totalRewardDebtZoinks
                .sub(rewardDebtZoinks);
        }
        if (_pid == 1) {
            uint256 rewardDebtSnacks = userInfo[_pid][msg.sender]
                .rewardDebtSnacks;
            if (rewardDebtSnacks > 0) {
                amountToSeniorage = block.timestamp < user.lastDepositDate + 1 days
                    ? rewardDebtSnacks / 2
                    : rewardDebtSnacks / 10;
                snacks.transferFrom(address(this), seniorageAddress, amountToSeniorage);
                snacks.transferFrom(address(this), msg.sender, rewardDebtSnacks - amountToSeniorage);
                userInfo[_pid][msg.sender].rewardDebtSnacks = 0;
                poolInfo[_pid].totalRewardDebtSnacks = poolInfo[_pid]
                    .totalRewardDebtSnacks
                    .sub(rewardDebtSnacks);
            }
            uint256 rewardDebtEthSnacks = userInfo[_pid][msg.sender]
                .rewardDebtEthSnacks;
            if (rewardDebtEthSnacks > 0) {
                amountToSeniorage = block.timestamp < user.lastDepositDate + 1 days
                    ? rewardDebtEthSnacks / 2
                    : rewardDebtEthSnacks / 10;
                ethSnacks.transferFrom(address(this), seniorageAddress, amountToSeniorage);
                ethSnacks.transferFrom(address(this), msg.sender, rewardDebtEthSnacks - amountToSeniorage);
                userInfo[_pid][msg.sender].rewardDebtEthSnacks = 0;
                poolInfo[_pid].totalRewardDebtEthSnacks = poolInfo[_pid]
                    .totalRewardDebtEthSnacks
                    .sub(rewardDebtEthSnacks);
            }
            uint256 rewardDebtBtcSnacks = userInfo[_pid][msg.sender]
                .rewardDebtBtcSnacks;
            if (rewardDebtBtcSnacks > 0) {
                amountToSeniorage = block.timestamp < user.lastDepositDate + 1 days
                    ? rewardDebtBtcSnacks / 2
                    : rewardDebtBtcSnacks / 10;
                btcSnacks.transferFrom(address(this), seniorageAddress, amountToSeniorage);
                btcSnacks.transferFrom(address(this), msg.sender, rewardDebtBtcSnacks - amountToSeniorage);
                userInfo[_pid][msg.sender].rewardDebtBtcSnacks = 0;
                poolInfo[_pid].totalRewardDebtBtcSnacks = poolInfo[_pid]
                    .totalRewardDebtBtcSnacks
                    .sub(rewardDebtBtcSnacks);
            }
            emit SnacksReward(msg.sender, rewardDebtSnacks, rewardDebtEthSnacks, rewardDebtBtcSnacks);
        }
        emit RewardTransfer(msg.sender, rewardDebtZoinks);
    }

    // Set seniorage address by owner
    function setSeniorage(address seniorage) public onlyOwner {
        seniorageAddress = seniorage;
    }
}
